<?php namespace Dolphin\CustomerAccountLinksManager\Controller\Account; class ExtendIndex extends \Magento\Customer\Controller\Account\Index {   public function execute()  {  	$objectManager =  \Magento\Framework\App\ObjectManager::getInstance();        	$storeManager  = $objectManager->get('\Magento\Store\Model\StoreManagerInterface');	$webID       = $storeManager->getStore()->getWebsiteId(); 		if($webID == 1){	 	    $resultRedirect = $this->resultRedirectFactory->create();         	$resultRedirect->setPath('/');	} else { 	    $resultRedirect = $this->resultRedirectFactory->create();         	$resultRedirect->setPath('sales/order/history');	}    return $resultRedirect;  }}